import '../C_dashboard/style_dashboard.css';

function Resource(props) {
  return (    
    <div class="reso">
        <div class="reso_detail1">{props.author}</div>
        <div class="reso_detail1">{props.school}</div>
        <div class="reso_detail1">{props.degree}</div>
        <div class="reso_detail1">{props.course}</div>
        <div class="reso_detail1">{props.type}</div>
        <div class="reso_detail1">{props.about}</div>
    </div>  
  );
}

export default Resource;
